import React, { Component } from 'react'

class UserGreeting extends Component {

    constructor(props) {
      super(props)
    
      this.state = {
         isLoggedIn: false
      }
    }
  render() {
    if(this.state.isLoggedIn){
        return <div></div>
    }
    return (
      <div>
        <div>Welcome Karoti</div>
        <div>Welcome Quest</div>
      </div>
    )
  }
}

export default UserGreeting
